package Programs;
import java.util.*;
public class Intersection2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       for(int i=4;i>=0;i--) {
    	   for(int j=0;j<10;j++) {
    		   int val=j+1;
    		   System.out.print(val +" ");
    		   if(val==4) {
    			   System.out.println();
    		   }
    		   if(val==7) {
    			   System.out.println();
    		   }
    		   if(val==9) {
    			   System.out.println();
    		   }
    	   }
    	   
    	   System.out.println();
       }
	}

}
